import descriptionVideo from "./CourseDescriptionTypes/Video";
import descriptionText from "./CourseDescriptionTypes/Text";
import { Link } from "react-router-dom";

function courseDescription(props) {
  console.log(props);

  return (
    <div className={style.container}>
      <div>{props.courseDescription.courseName}</div>
      <div>
        <img src={props.courseDescription.mainImage} width={700} alt="" />
      </div>
      <div>{props.courseDescription.blocks.map((p) => {})}</div>
    </div>
  );
}
export default courseDescription;
